import React from "react";

interface NavBarProps {
  loggedIn: boolean;
}

function NavBar({ loggedIn }: NavBarProps) {
  return (
    <div>
      <nav>
        <div>
          <a href="/">Home</a>
          <a href="/snake">Snake</a>
          <a href="/minesweeper">Minesweeper</a>
          <a href="/leaderboard">Leaderboard</a>
        </div>
        <div></div>
      </nav>
    </div>
  );
}

export default NavBar;
